import React from 'react'
import {Navbar, Nav, NavDropdown} from 'react-bootstrap'

export default class NavBar extends React.Component{
    render(){
        return (
            // <Navbar bg="light" expand="lg" variant="light">
            //     <Navbar.Brand href="#home"><h3>Find My Pup</h3></Navbar.Brand>
            //     <Navbar.Toggle aria-controls="basic-navbar-nav" />
            //     <Navbar.Collapse id="basic-navbar-nav">
            //         <NavDropdown title="Sort By Price" id="basic-nav-dropdown" variant="dark">
            //             <NavDropdown.Item href="#action/3.1">Highest to Lowest</NavDropdown.Item>
            //             <NavDropdown.Item href="#action/3.2">Lowest to Highest</NavDropdown.Item>
            //         </NavDropdown>
            //         <Nav className="mr-auto">
            //         <Nav.Link href="#home">My Pup Cart</Nav.Link>
            //         </Nav>
            //     </Navbar.Collapse>
            // </Navbar>
            <Navbar collapseOnSelect expand="lg" bg="info" variant="dark">
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto">
                    <Nav.Link href="#features">Features</Nav.Link>
                    <Nav.Link href="#pricing">Pricing</Nav.Link>
                    <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                    </NavDropdown>
                    </Nav>
                    <Nav>
                        <Nav.Link href="#deets">More deets</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
</Navbar>
        )
    }
}
